import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { useLocation, useHistory } from 'react-router-dom';
import './assets/styles/main.scss';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import Home from './pages/Home';
import About from './pages/About';
import Portfolio from './pages/Portfolio';
import Creative from './pages/Creative';
import TaskClear from './pages/projects/TaskClear';
import BruinHive from './pages/projects/BruinHive';
import ClassBuddi from './pages/projects/ClassBuddi';
import AASC from './pages/projects/AASC';
import FanSpace from './pages/projects/FanSpace';
import NotFound from './pages/NotFound/NotFound';
import { AnimatePresence } from 'framer-motion';
import Transition from './components/transition';

function AnimatedRoutes() {
  const lcoation = useLocation();

}
function App() {

  return (
    <Router>
      <Header />
      <AnimatePresence>
      <Switch>
        <Route exact path="/"><Transition><Home /></Transition></Route>
        <Route path="/about"><Transition><About /></Transition></Route>
        <Route path="/creative"><Transition><Creative /></Transition></Route>
        <Route path="/portfolio"><Transition><Portfolio /></Transition></Route>
        <Route path="/projects/fanspace"><Transition><FanSpace /></Transition></Route>
        <Route path="/projects/bruinhive"><Transition><BruinHive /></Transition></Route>
        <Route path="/projects/AASC"><Transition><AASC /></Transition></Route>
        <Route path="/projects/classbuddi"><Transition><ClassBuddi /></Transition></Route>
        <Route path="/projects/taskclear"><Transition><TaskClear /></Transition></Route>
      </Switch>
      </AnimatePresence>
     <Footer/>
    </Router>
  );
};

export default App;
